import React from 'react';
import { render } from 'react-dom';
import MultiRangeSlider from '../../components/MultiRangeSlider/MultiRangeSlider';

const split = () => (
  <div>
    <div
      style={{
        width: '80vw',
        height: '80vh',
        margin: '24px auto',
        background: '#fff',
        borderRadius: '20px',
      }}
    >
      캔버스 영역
    </div>
    <MultiRangeSlider min={0} max={1000} />;
  </div>
);

export default split;
